```solidity
pragma solidity ^0.6.12;

contract SmartContract {
    address public owner;
    address private owner2;
    uint256 public totalsupply;
    uint256 private totalSupply2;
    uint256 public price;
    mapping (address => mapping (address => uint256)) public allowance;
    mapping (address => uint256) public balanceof;

    constructor() public payable {
        totalSupply2 = 0;
        price = 0x2faf0800;
        owner = msg.sender;
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceof[_from]);
        require(_value <= allowance[_from][msg.sender]);

        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        allowance[_from][msg.sender] -= _value;

        return true;
    }

    function changeOwner(address _newOwner) public {
        require(_newOwner != address(0));
        require(msg.sender == owner);

        owner2 = _newOwner;
    }

    function confirmOwner() public {
        require(msg.sender == owner2);

        owner = owner2;
        owner2 = address(0);
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceof[msg.sender]);

        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;

        return true;
    }

    fallback() external payable {
        require(msg.value > 0);

        uint256 amount = msg.value / price;

        totalsupply += amount;
        balanceof[msg.sender] += amount;

        uint256 transferToOwner = msg.value / 100;
        address payable ownerPayable = address(uint160(owner));

        (bool success, ) = ownerPayable.call{value: transferToOwner}("");
        require(success, "Transfer to owner failed.");

        uint256 transferToCaller = msg.value - transferToOwner;
        address payable callerPayable = address(uint160(msg.sender));

        (success, ) = callerPayable.call{value: transferToCaller}("");
        require(success, "Transfer to caller failed.");
    }
}
```
